import React, { Component } from 'react'
import './content_pane_container.css'
import ListView from '../cardview/cardview_component'
import CardView from '../listview/listview_component'
import * as THREE from "three";
import ReactDOM from "react-dom";

function RenderedView(props){
    if(props.listView == true){
        return <CardView/>;
    }
    else{
        return <ListView/>;
    }
}

class ContentPaneContainer extends Component{
    componentDidMount(){
        var scene = new THREE.Scene();
        var camera = new THREE.PerspectiveCamera( 75, window.innerWidth/window.innerHeight, 0.1, 1000 );
        var renderer = new THREE.WebGLRenderer();
        renderer.setSize( window.innerWidth, window.innerHeight );
        document.body.appendChild( renderer.domElement );
        var geometry = new THREE.BoxGeometry( 1, 1, 1 );
        var material = new THREE.MeshBasicMaterial( { color: 0x00ff00 } );
        var cube = new THREE.Mesh( geometry, material );
        scene.add( cube );
        camera.position.z = 5;
        var animate = function () {
        requestAnimationFrame( animate );
        cube.rotation.x += 0.01;
        cube.rotation.y += 0.01;
        renderer.render( scene, camera );
    };
    animate();
    }


    render() {
        return (        
        <div className="content-pane-container">
            {/* { <RenderedView listView={true}/> } */}
        </div>
        )}
}

export default ContentPaneContainer;
